import './login.css';
import logo from '../resources/VAL_LOGO_STARTS.svg';

class LoginPage extends React.Component { 
    render () { 
        return ( 
            <div className="App">
            <header className="App-header">
              <object type="image/svg+xml" data={logo} className="App-logo" alt="logo" >  
              </object>
            </header>
            </div>
        )
    }
} 


export default LoginPage
